class Solution:
    def numSub(self, s: str) -> int:
        prime = 1000000007
        array = [0]
        for c in s:
            if c == "1":
                if array[-1] > 0:
                    array[-1] += 1
                else:
                    array.append(1)
            else:
                if array[-1] > 0:
                    array.append(0)
        result:int = 0
        for item in array:
            result += (1 + item) * item // 2
            if result >= prime:
                result %= prime
        return result

solu = Solution()
s = ""
result = solu.numSub(s)
print(result)